import React from 'react'
import { BrowserRouter, Link } from 'react-router-dom'
const Home = () => {
  return (
    <div>
    <BrowserRouter>
      
      <Link to="/dashboard/formation" >Formation</Link>
      <Link to="/dashboard/tableau" >Tableau</Link>
    </BrowserRouter>
    </div>
  )
}

export default Home
